import React, { Component } from 'react'

class QuestionCard extends Component {
  render() {
    return(
      <div className='question-card'>
        <h1 class='special-text'>would you rather</h1>
          <form>
             <input type="radio" name="OptionA" value="OptionA"  /> Option A<br/>
             <input type="radio" name="OptionB" value="OptionB" /> Option B<br/>
             <input type="submit" value="Vote"/>
          </form>
      </div>
    )
  }
}

export default QuestionCard
